10 jaar na de gebeurtenissen in de vorige film hebben de nu getrouwde Rick en Evelyn zich gesetteld in London, samen met hun 9-jarige zoontje Alex. Als het lijk van Imhotep in het Britse Museum tot leven wordt gewekt, is de mummy opnieuw op zoek naar eeuwig leven. Rick en Evelyn moeten opnieuw proberen om de wereld te redden van het kwaad, en ondertussen moeten ze ook nog hun zoontje redden.



